import * as React from "react";
import { styled, alpha } from "@mui/material/styles";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import InputBase from "@mui/material/InputBase";
import SearchIcon from "@mui/icons-material/Search";
import { useState } from "react";
import { fetchTracks } from "../../api/track/trackApi";
import { GetModel } from "../../api/track/models/CreateTrack";
import { Track } from "../../api/track/models/Track";
import { PageList } from "../../types/PageList";
import { Typography } from "@mui/material";

const Search = styled("div")(({ theme }) => ({
  position: "relative",
  borderRadius: theme.shape.borderRadius,
  backgroundColor: alpha("#3E2723", 0.1),
  "&:hover": {
    backgroundColor: alpha("#3E2723", 0.2),
  },
  marginLeft: 0,
  width: "100%",
  [theme.breakpoints.up("sm")]: {
    marginLeft: theme.spacing(1),
    width: "auto",
  },
}));

const SearchIconWrapper = styled("div")(({ theme }) => ({
  padding: theme.spacing(0, 2),
  height: "100%",
  position: "absolute",
  pointerEvents: "none",
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
  color: "#3E2723",
}));

const StyledInputBase = styled(InputBase)(({ theme }) => ({
  color: "#3E2723",
  width: "100%",
  "& .MuiInputBase-input": {
    padding: theme.spacing(1, 1, 1, 0),
    // vertical padding + font size from searchIcon
    paddingLeft: `calc(1em + ${theme.spacing(4)})`,
    transition: theme.transitions.create("width"),
    [theme.breakpoints.up("sm")]: {
      width: "12ch",
      "&:focus": {
        width: "20ch",
      },
    },
  },
}));

type Props = {
  onSearch: (results: PageList<Track>) => void;
};

export const SearchAppBar: React.FC<Props> = ({ onSearch }) => {
  const [input, setInput] = useState("");
  const [allTracks, setAlltracks] = useState<Track[]>([]);
  const [searchResults, setSearchResults] = useState<PageList<Track> | null>(
    null
  );

  const searchTrack = async (value: string) => {
    setInput(value);

    const model: GetModel = {
      page: 1,
      limit: 100,
      sort: "",
      search: value,
      genre: "",
      artist: "",
      order: "asc",
    };

    const response = await fetchTracks(model);

    if (response && response.data) {
      setAlltracks(response.data);
      setSearchResults(response);
      onSearch(response);
    } else {
      setSearchResults({
        data: [],
        meta: { page: 1, limit: 10, total: 0, totalPages: 0 },
      });
      onSearch({
        data: [],
        meta: { page: 1, limit: 10, total: 0, totalPages: 0 },
      });
    }
  };

  return (
    <Box sx={{ width: "100%", px: 2, py: 4 }}>
      <Box sx={{ position: "relative", maxWidth: 800, mx: "auto" }}>
        {/* Main Search Container */}
        <Box sx={{ position: "relative" }}>
          {/* Animated gradient border */}
          <Box
            sx={{
              position: "absolute",
              inset: "-2px",
              background:
                "linear-gradient(135deg, #667eea 0%, #ec4899 50%, #3b82f6 100%)",
              borderRadius: 4,
              opacity: isFocused ? 0.75 : 0,
              filter: isFocused ? "blur(12px)" : "blur(0px)",
              transition: "all 0.5s cubic-bezier(0.4, 0, 0.2, 1)",
              "&:hover": {
                opacity: isFocused ? 0.75 : 0.6,
              },
            }}
          />

          {/* Search Bar */}
          <Box
            sx={{
              position: "relative",
              display: "flex",
              alignItems: "center",
              background: "#ffffff",
              borderRadius: 4,
              boxShadow: "0 10px 40px rgba(0, 0, 0, 0.1)",
              overflow: "hidden",
              transition: "all 0.3s cubic-bezier(0.4, 0, 0.2, 1)",
              "&:hover": {
                boxShadow: "0 20px 60px rgba(102, 126, 234, 0.2)",
              },
            }}
          >
            {/* Icon Container */}
            <Box
              sx={{
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
                pl: 3,
                pr: 2,
              }}
            >
              <Box
                sx={{
                  transition: "all 0.3s ease",
                  transform: isFocused
                    ? "scale(1.1) rotate(12deg)"
                    : "scale(1) rotate(0deg)",
                }}
              >
                {isFocused ? (
                  <AutoAwesomeIcon sx={{ fontSize: 26, color: "#667eea" }} />
                ) : (
                  <SearchIcon sx={{ fontSize: 26, color: "#9ca3af" }} />
                )}
              </Box>
            </Box>

            {/* Input Field */}
            <InputBase
              placeholder="Search for tracks, artists, albums..."
              value={input}
              onChange={(e) => setInput(e.target.value)}
              onFocus={() => setIsFocused(true)}
              onBlur={() => setIsFocused(false)}
              onKeyDown={(e) => {
                if (e.key === "Enter" && input.trim()) {
                  searchTrack(input);
                }
              }}
              sx={{
                flex: 1,
                py: 2.5,
                pr: 2,
                fontSize: "1rem",
                fontWeight: 500,
                color: "#1f2937",
                "& input::placeholder": {
                  color: "#9ca3af",
                  fontWeight: 400,
                  opacity: 1,
                },
              }}
            />

            {/* Action Hint */}
            {input && (
              <Fade in={true}>
                <Box
                  sx={{
                    display: { xs: "none", sm: "flex" },
                    alignItems: "center",
                    gap: 0.5,
                    px: 2,
                    py: 1,
                    mr: 2,
                    borderRadius: 2,
                    background:
                      "linear-gradient(135deg, #667eea 0%, #ec4899 100%)",
                    boxShadow: "0 4px 12px rgba(102, 126, 234, 0.3)",
                  }}
                >
                  <Typography
                    variant="caption"
                    sx={{
                      color: "#ffffff",
                      fontWeight: 700,
                      fontSize: "0.75rem",
                      letterSpacing: "0.5px",
                    }}
                  >
                    Enter
                  </Typography>
                  <Typography sx={{ color: "#ffffff", fontSize: "0.9rem" }}>
                    ↵
                  </Typography>
                </Box>
              </Fade>
            )}
          </Box>
        </Box>

        {/* Floating particles effect */}
        {isFocused && (
          <>
            <Box
              sx={{
                position: "absolute",
                top: 0,
                left: "25%",
                width: 8,
                height: 8,
                bgcolor: "#a78bfa",
                borderRadius: "50%",
                animation: "ping 1s cubic-bezier(0, 0, 0.2, 1) infinite",
                opacity: 0.4,
                "@keyframes ping": {
                  "75%, 100%": {
                    transform: "scale(2)",
                    opacity: 0,
                  },
                },
              }}
            />
            <Box
              sx={{
                position: "absolute",
                top: 0,
                right: "25%",
                width: 6,
                height: 6,
                bgcolor: "#ec4899",
                borderRadius: "50%",
                animation: "ping 1s cubic-bezier(0, 0, 0.2, 1) infinite",
                animationDelay: "0.2s",
                opacity: 0.4,
                "@keyframes ping": {
                  "75%, 100%": {
                    transform: "scale(2)",
                    opacity: 0,
                  },
                },
              }}
            />
            <Box
              sx={{
                position: "absolute",
                bottom: 0,
                left: "33%",
                width: 4,
                height: 4,
                bgcolor: "#3b82f6",
                borderRadius: "50%",
                animation: "ping 1s cubic-bezier(0, 0, 0.2, 1) infinite",
                animationDelay: "0.4s",
                opacity: 0.4,
                "@keyframes ping": {
                  "75%, 100%": {
                    transform: "scale(2)",
                    opacity: 0,
                  },
                },
              }}
            />
          </>
        )}

        {/* Bottom decorative line */}
        <Box
          sx={{
            position: "relative",
            mt: 2,
            height: 2,
            overflow: "hidden",
            borderRadius: 2,
          }}
        >
          <Box
            sx={{
              height: "100%",
              background:
                "linear-gradient(90deg, transparent 0%, #667eea 50%, transparent 100%)",
              opacity: isFocused ? 1 : 0.3,
              transform: isFocused ? "scaleX(1)" : "scaleX(0.5)",
              transition: "all 0.5s cubic-bezier(0.4, 0, 0.2, 1)",
            }}
          />
        </Box>

        {/* Quick suggestions */}
        {isFocused && !input && (
          <Fade in={true} timeout={300}>
            <Box
              sx={{
                display: "flex",
                flexWrap: "wrap",
                gap: 1.5,
                justifyContent: "center",
                mt: 3,
              }}
            >
              {quickSuggestions.map((tag, index) => (
                <Grow
                  key={tag}
                  in={true}
                  timeout={300 + index * 100}
                  style={{ transformOrigin: "0 0 0" }}
                >
                  <Chip
                    label={tag}
                    onClick={() => setInput(tag)}
                    sx={{
                      px: 1.5,
                      py: 2.5,
                      fontSize: "0.875rem",
                      fontWeight: 500,
                      color: "#6b7280",
                      bgcolor: "#f9fafb",
                      border: "1px solid transparent",
                      transition: "all 0.2s ease",
                      "&:hover": {
                        background:
                          "linear-gradient(135deg, rgba(102, 126, 234, 0.1) 0%, rgba(236, 72, 153, 0.1) 100%)",
                        color: "#667eea",
                        border: "1px solid rgba(102, 126, 234, 0.2)",
                        transform: "scale(1.05) translateY(-2px)",
                        boxShadow: "0 4px 12px rgba(102, 126, 234, 0.15)",
                      },
                    }}
                  />
                </Grow>
              ))}
            </Box>
          </Fade>
        )}
      </Box>

      {/* Demo Results */}
      <Box sx={{ mt: 8, maxWidth: 800, mx: "auto" }}>
        <Typography
          variant="body2"
          sx={{
            textAlign: "center",
            color: "#6b7280",
          }}
        >
          {input ? `Searching for: "${input}"` : "Start typing to search..."}
        </Typography>
      </Box>
    </Box>
  );
};
